INSERT INTO `Event` VALUES (3,'Music Night','1970-01-21 15:00:00.000','Get ready to groove to the rhythm at our Music Night! Sit back and relax as talented local musicians take the stage to perform a mix of your favorite tunes. It\'s the perfect way to unwind and enjoy some great music',NULL,'https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/73722b5023e768b2333407bffa465233aa199196,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/deba2409c34cc8f6e5a7de852b49aa130fab4b81,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/47bea42b49410f88a8f500d788ba0ab47015fd28','musical','Homagama','{\"lat\":6.8412384,\"lng\":80.0034457}','public','34a89ebd-56a9-4bd1-a725-b608a0bb9db2',1),(4,'Sports Day','2024-03-25 03:30:00.000','Calling all sports enthusiasts! Join us for a day filled with friendly competition and sportsmanship at our Sports Day event. From soccer to tug-of-war, there\'s something for everyone to enjoy.',NULL,'https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/918f0477c946bfa43c6790bbdead420775ff8891,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/e9638b1266336d1915039917581db0725039afc2,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/1f8f1ff630d7dc206759efcd65e2126bea0c3a3d,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/9bfa36cacdb60921129b5bba1f4b22324ba46e05,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/541630b1bd9234bc05dc7cf11d88b58a37382a17','sports','Pannipitiya','{\"lat\":6.8464397,\"lng\":79.9486254}','public','bec67bb1-ed27-477b-9be4-24a54776af27',1),(5,'Fun Fair','2024-03-29 11:30:00.000','Join us for a day of fun and excitement at our Fun Fair! Enjoy a variety of carnival games, delicious food stalls, thrilling rides, and entertainment for the whole family.',NULL,'https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/1c8b9ea7bea3f44ba8d7c4c989376f124161250d,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/c0f523ad854d058897710ae9d3904ff85617f3c9,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/5838e27ef4249f89034a21987f43bf8845143616,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/788b9a2d12ea18bdf043d8248df5c1b9f03cdd1d,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/96ef5bc0f602e2438493d9401dde3aca03075c8f,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/16098a2b01a5b375a46b5fd3694ddb8c26e33de4','other','Pitipana','{\"lat\":6.8263658,\"lng\":80.0289553}','public','9b19a508-1cca-4872-8ba2-ded6722317f0',1),(6,'Charity Walk','1970-01-20 19:22:13.800','Lace up your sneakers and join us for a Charity Walk to support a good cause! Walk alongside friends and neighbors as we raise awareness and funds for charity organizations working towards a brighter future',NULL,'https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/0c6e374308905eea0c6310e1532c1005b1a0e14d,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/eb365a0b08b8e33c1c9d105d6f14a94c1b1d492f,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/5cd166a45314267a6d92a74a73188fe07b0a9d4a,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/04629dcbbbaa9bb1665464b58417e393c88584ea,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/a96da6f685e72e0c871970badb7a5a39d6c00ee4','charity','Kottawa','{\"lat\":6.8430139,\"lng\":79.9655312}','public','9852cf65-209d-4fc6-9ab7-2f39ae60c4e0',1),(7,'Food Festival','2024-03-26 03:30:00.000','Indulge your taste buds at our Food Festival! Explore a diverse array of culinary delights from around the world, including mouthwatering street food, gourmet treats, and refreshing beverages',NULL,'https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/17f5d3566117f785e0656af7cda2386f144a64d6,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/4571e048d6b7510e1efc229b9c8674df908c8556,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/afdd10a54f6e42c377bf080df89077679922e756','other','Homagama','{\"lat\":6.8412384,\"lng\":80.0034457}','public','d29b0e88-1287-4acf-9227-420af1c50026',1),(8,'Pet Parade','2024-04-06 05:00:00.000','Calling all pet lovers! Dress up your furry friends and join us for a Pet Parade extravaganza. Show off your pet\'s unique style and personality as they strut their stuff down the parade route. It\'s a paw-some event that\'s fun for pets and owners alike!',NULL,'https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/499805e15396f1df2bbb4028969edc2bf3c37b41,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/d665a10460f7fc2f12a04822b725ae6c059b5152,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/2986b807c6a28ca229548eaa0eb6775e05333448,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/ac58cfca0024a672a294bb3d60478a1c6e385f4f,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/44faca86bf9bf829405a884bdd3eebd8b35a5452','other','Pannipitiya','{\"lat\":6.8464397,\"lng\":79.9486254}','public','3963b7f7-5aa6-4952-b6cd-3c72622e4f39',1),(9,'Talent Show','2024-04-05 11:30:00.000','Showcase your talents or cheer on local performers at our Talent Show event! From singing and dancing to magic tricks and comedy acts, it\'s a showcase of talent and creativity that promises to entertain audiences of all ages',NULL,'https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/02770d9f92473aa65f092479fe2f54c8d2e25a75,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/8df5a9b224bd2f384c2d2937d7f906339783826b,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/dd73152825b25b4ebd602707d90a4e83353be96c,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/cce35f406a9a2607355254cb60e49f2c6a78b66a,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/0e5cec4891c891349666e50b851d22a29eecac1c','other','Pitipana','{\"lat\":6.8263658,\"lng\":80.0289553}','public','b7033a0b-cfc8-45c4-a662-37f874f7e776',1),(10,'Community Cleanup','2024-04-10 05:30:00.000','Roll up your sleeves and join us for a Community Cleanup event! Together, we\'ll work to beautify our neighborhood by picking up litter, planting trees, and sprucing up public spaces. It\'s a hands-on opportunity to make a positive impact and show pride in our\n\n\n\n\n',NULL,'https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/6461def2177e1d928095851f5998290242927fa9,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/b28ef901d4f9905516ed5b7855bcb481c31f801c,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/d664ca6fdc15510937aced9b3212f0a5123d4dab,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/c795dab90f5fb32e10e8c3a7338d34dfc8344e21,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/69b932a0aa4faad8bf6a2d5590e4d5e40f447a17','other','Godagama','{\"lat\":6.850694,\"lng\":80.0324106}','public','5e5946cb-0e37-43eb-abba-f759010a9bd4',1),(11,'Movie Night','2024-03-29 13:30:00.000',' Grab your popcorn and join us for a Movie Night under the stars! Sit back, relax, and enjoy a screening of a family-friendly film in a cozy outdoor setting. It\'s the perfect way to unwind and enjoy quality time with loved ones.',NULL,'https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/1e228c3015d6f3c959350dac93d351f08c7dc682,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/090c53c7c78db659fce95e5db5170404c1b7fa70,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/59da5d19f8c06137820fc5f8a2f3381a7fef66a5,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/023e1b754c607d24f8bab3e6203ee6d3a884a589,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/4d2fb4913d7c2a762c0c85ebfc9298c7d232ee39','other','Homagama','{\"lat\":6.8412384,\"lng\":80.0034457}','public','0062aada-d91b-43c6-8890-3f1206de7554',1),(12,'Career Exploration Expo','2024-04-09 03:30:00.000','Explore career opportunities, gain insights, and network with industry experts at our Career Exploration Expo! Discover your path to success with valuable resources and connections. Don\'t miss this chance to take the next step in your career journey!',NULL,'https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/07f14e923e991845d81a91d957e1c957da5308fc,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/9c4109cfc4356d6321ed9ccf1a0995698cb5674a,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/aa99a52142cbf77de778223d5ea3232689c8ec87,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/42a9a0cc4aea639850baac7d8322b72594ac3f1f,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/f670f61d0166cebb643973e7ae92f5a6d4acace5,https://eventhive.sgp1.digitaloceanspaces.com/eventowner/1/files/images/e8ad4cda799cb8811d9440516dc5eca4631c4707','educational','Colombo','{\"lat\":6.9388614,\"lng\":79.8542005}','public','de6b539f-b65c-4842-aa6f-48d86d83dda8',1);
INSERT INTO `Ticket` VALUES (5,1000,'Genaral Addmission','Secure your spot at our Music Night with a General Admission ticket! Join us for an evening of live music featuring talented local artists. With your ticket, you\'ll have access to the concert venue and the chance to enjoy an unforgettable night of music',3),(6,2000,'VIP Seating',' Upgrade to our VIP Pass for a truly special experience at the Fun Fair! Enjoy fast-track access to all attractions, exclusive VIP areas with premium amenities, and complimentary refreshments. Treat yourself to the ultimate day out with our VIP Pass!',3),(7,1000,'General Admission','Grab your popcorn and join us for a movie under the stars with a General Admission ticket to Movie Night! Sit back, relax, and enjoy a screening of a family-friendly film in a cozy outdoor setting. It\'s the perfect way to unwind and enjoy quality time with loved ones.',11),(8,2000,'VIP Seating ','Upgrade to VIP Seating for the ultimate movie experience! With premium seating and complimentary snacks, you\'ll enjoy unparalleled comfort and luxury throughout the screening. Treat yourself to VIP treatment and make memories that will last a lifetime.',11);
